@betsy_paints made my Friday with this gorgeous painting 🖼️ that is giving me allll the THE SUMMER OF SONGBIRDS vibes. Did you know that it’s set at a sailing camp?? 

I love Betsy Paints’s beautiful work and this gorgeous piece will have a permanent place in my beloved bookshelf!

(And your LAST reminder that my Songbirds are 25% off at @barnesandnoble ❤️❤️❤️)

Happiest pub week to my dear friends @susanmallery, @amyimpellizzeri, @juliecdalton, and @andreadunlop! 

@bakesbyjill made these gorgeous cookies, so that I could thank Susan for the most gorgeous blurb that she just wrote and I cannot wait to share. Her new story of sisterhood is a cannot miss!

@amyimpellizzeri has been one of my favorite writers since we became @tallpoppywriters together 100 years ago 😊 (okay, 8 years?) my first favorite book of hers was Lemongrass Hope, and I’ve been hooked ever since!

@juliecdalton is the most exquisite writer (and also a fellow @tallpoppywriters) and I can’t wait to dive into her new release—and have dinner with her in Boston on Monday!! Woo hoo!

I am so excited that  @zibbyowens introduced me to the FIERCE @andreadunlop! So thrilled for this buzzy new title out from @zibbybooks! 

all four of these books are completely different so there’s no way you could possibly choose just one! If you need me I’ll be reading!

